@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:NoResponseFromBankComputer
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasResponseTime ;
        owl:hasValue 2 ;
        owl:allValuesFrom atm:Minute
    ] .

atm:CardRejected
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasErrorMessage ;
        owl:someValuesFrom atm:ErrorMessage
    ] .

atm:hasResponseTime
    a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Minute .

atm:hasErrorMessage
    a owl:ObjectProperty ;
    rdfs:domain atm:Card ;
    rdfs:range atm:ErrorMessage .

atm:BankComputer
    a owl:Class .

atm:Card
    a owl:Class .

atm:Minute
    a owl:Class .

atm:ErrorMessage
    a owl:Class .

[] a owl:AllDisjointClasses ;
    owl:members (atm:BankComputer atm:Card atm:Minute atm:ErrorMessage) .

[] a owl:AllDisjointProperties ;
    owl:members (atm:hasResponseTime atm:hasErrorMessage) .
